import { Formik } from 'formik';
import './Login.css';

export default function Login() {
    return (
        <form>
            <div>
                <label>Email</label>
                <input type="email" name="email" />
            </div>
            <div>
                <label>Contraseña</label>
                <input type="password" name="password" />
            </div>
            <div>
                <input type="submit" value="Enviar"></input>
            </div>
        </form>
    );
}
